import React, {Component} from 'react';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import { Card, Descriptions, Statistic, Progress, List } from 'antd';

class Detail extends Component{
    render(){
        return(
            <div>
            <Card style={{margin:80, display:'block', marginLeft:'auto', marginRight:'auto', width:800, background:'#f5f5f5', borderRadius:'20px'}} >
            <Descriptions >
                <Descriptions.Item><Statistic title = "Consumed" value ={60.5}></Statistic></Descriptions.Item>
                <Descriptions.Item>
                <Progress style ={{width:30}} type="circle" percent={90} format={percent => `${percent} % Budget`}/>
                </Descriptions.Item>
                <Descriptions.Item><Statistic title = "Exercise" value = {50}></Statistic></Descriptions.Item>         
            </Descriptions>
            </Card>
        </div>
        )
    }
}
export default Detail
